let datasetEntirePopulation = function(datasetIn) {
    let data = []
    let dataset = datasetIn
    data.push({name: "Income Distribution, Russia 2020)", children: []})
    data[0].children.push({name: "Entire Population", children: []})
    for (let i = 0; i < dataset.length; i++) {
      data[0].children[0].children.push({
        population: dataset[i].population, 
        populationIncomeYear: dataset[i].populationIncomeYear, 
        incomeMin: dataset[i].incomeMin, 
        incomeMean: dataset[i].incomeMean, 
        incomeMax: dataset[i].incomeMax
      })
    }
    return data
  }

  let datasetSocialGroups = function(datasetIn) {
    let lowIncome = 16000
    let middleIncome = 40000
    let highIncome = 70000
    let veryHighIncome = 100000
  
    let data = []
    let dataset = datasetIn
    data.push({name: "Income Distribution, Russia 2020)", children: []})
    data[0].children.push({name: "Low Income", children: []})
    data[0].children.push({name: "Middle Income", children: []})
    data[0].children.push({name: "Upper Middle Income", children: []})
    data[0].children.push({name: "High Income", children: []})
    data[0].children.push({name: "Very High Income", children: []})
  
    for (let i = 0; i < dataset.length; i++) {
      if (dataset[i].incomeMean < lowIncome) {
        data[0].children[0].children.push({
          population: dataset[i].population, 
          populationIncomeYear: dataset[i].populationIncomeYear, 
          incomeMin: dataset[i].incomeMin, 
          incomeMean: dataset[i].incomeMean, 
          incomeMax: dataset[i].incomeMax
        })
      } else if (dataset[i].incomeMean < middleIncome) {
        data[0].children[1].children.push({
          population: dataset[i].population, 
          populationIncomeYear: dataset[i].populationIncomeYear, 
          incomeMin: dataset[i].incomeMin, 
          incomeMean: dataset[i].incomeMean, 
          incomeMax: dataset[i].incomeMax
        })
      } else if (dataset[i].incomeMean < highIncome) {
        data[0].children[2].children.push({
          population: dataset[i].population, 
          populationIncomeYear: dataset[i].populationIncomeYear, 
          incomeMin: dataset[i].incomeMin, 
          incomeMean: dataset[i].incomeMean, 
          incomeMax: dataset[i].incomeMax
        })
      } else if (dataset[i].incomeMean < veryHighIncome) {
        data[0].children[3].children.push({
          population: dataset[i].population, 
          populationIncomeYear: dataset[i].populationIncomeYear, 
          incomeMin: dataset[i].incomeMin, 
          incomeMean: dataset[i].incomeMean, 
          incomeMax: dataset[i].incomeMax
        })
      } else {
        data[0].children[4].children.push({
          population: dataset[i].population, 
          populationIncomeYear: dataset[i].populationIncomeYear, 
          incomeMin: dataset[i].incomeMin, 
          incomeMean: dataset[i].incomeMean, 
          incomeMax: dataset[i].incomeMax
        })
      }
    }
    
    return data
  }

